Storyline:

Joining Jools for the sixth show of this series are Arctic Monkeys, who made their
TV debut on the show back in 2005. The band make a welcome return to the show to
perform tracks from their upcoming fourth album Suck It And See.

The legendary singer, songwriter and film composer Randy Newman is also in the
studio with a number or two from his new album The Randy Newman Songbook Vol.2.

Leader, arranger and chief songwriter of The Beach Boys Brian Wilson finally makes
his Later debut performing a couple of tracks with his current band from his
extraordinary catalogue of songs.

Also in the studio, Alison Krauss &amp; Union Station are performing songs from their
new Paper Airplane collection.

From LA, female four-piece Warpaint are making their Later debut with tracks from
2010s acclaimed The Fool, and from London, hotly tipped reggae act Gappy Ranks
is also performing.

